import styles from '../dashboard.module.scss';
import Navbar from '../../common/navbar/Navbar';
import { Stepper } from 'react-form-stepper';
import DropdownBar from '../../common/dropdownBar/DropdownBar';
import Dronedisplay from '../../common/droneDisplay/Dronedisplay';

import axios from 'axios';
import { url } from '../../utils/constants';

import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

import { useParams } from 'react-router-dom';
import { useEffect, useState } from 'react';

function BookDroneServiceTwo()   {

    const { id } = useParams()

    const [drones, setDrones] = useState();

    useEffect(() => {
        axios.get(`${url}/api/drone/`, {
            "Content-Type": "application/json",
        })
            .then(function (response) {
                console.log(response.data.data);
                const availableDrones = response.data.data.filter(function(drone) {
                    return drone.status === "available"
                })
                setDrones(availableDrones);
            })
            .catch(function (error) {
                console.log(error);
                alert("error")
            });
    }, [])

    console.log('drones', drones)

    return (
        <>
            <Navbar />
            <div className={styles['container']}>
                <div className={styles['sidebar']}>
                    <div className={styles['title']}>
                        Dashboard
                    </div>
                    <div className={styles['options']}>
                        <div className={styles['option']}>
                            Maintenance
                        </div>
                        <div className={styles['option-select']}>
                            Book Drone Service
                        </div>
                        <div className={styles['option']}>
                            My Bookings
                        </div>
                        <div className={styles['option']}>
                            Service Reports
                        </div>
                        <div className={styles['option']}>
                            Profile
                        </div>
                    </div>
                </div>
                <div className={styles['body']}>
                    <div className={styles['info-container']}>
                        <Stepper 
                            steps={[{}, {}, {}]}
                            activeStep={1}
                        />
                        <div className={styles['header']}>
                            Step 2: Drone Catalog
                        </div>
                        <div className={styles['sub-header']}>
                            Select a service and choose your drone
                        </div>
                    </div>

                    <DropdownBar />

                    <br/><br/>

                    {drones && drones.length} Drone Found

                    {
                        drones &&
                        <div className={styles['show-farms']}>
                        {
                            drones.map((drone, index) => {
                                return (
                                    <div className={styles['show-farm']} key={drone._id}>
                                    <Card style={{ width: '18rem' }}>
                                        <Card.Img variant="top" src="https://i.picsum.photos/id/676/536/354.jpg?hmac=AUe7ybcPXLBm37YhZd49jpbOql4HORAAWX-WUPSOhjg" />
                                        <Card.Body>
                                            <Card.Title>{drone.name}</Card.Title>
                                            <Card.Text>{drone.model}</Card.Text>
                                            <Card.Text>{drone.service}</Card.Text>
                                            <Card.Text>{drone.country}</Card.Text>
                                            <Card.Text>{drone.zipcode}</Card.Text>
                                            <Button variant="primary" style={{ fontSize: "16px" }} onClick={() => window.location=`/dashboard/farmer/bookDroneServiceTwo/${farm._id}`}>Select</Button>
                                        </Card.Body>
                                    </Card>
                                    </div>
                                )
                            })
                        }
                    </div>
                    }

                    <br/><br/>

                    <div className={styles['navigate-btn']}>
                        <button className={styles['grey']}>Back</button>
                        <button className={styles['blue']}>Save</button>
                    </div>

                </div>
            </div>
        </>
    )
}

export default BookDroneServiceTwo;
